import sys
import base64
from PyQt5.QtWidgets import QApplication, QMainWindow, QPushButton, QVBoxLayout, QLineEdit, QFormLayout, QWidget, QLabel, QMessageBox, QFileDialog, QHBoxLayout, QSizePolicy, QSpacerItem, QDialog, QComboBox
from PyQt5.QtGui import QIcon, QPixmap
from PyQt5.QtCore import QSettings, QProcess, QTranslator, QLocale, Qt
import os

class HostDialog(QDialog):
    def __init__(self, exePath):
        super().__init__()
        self.setWindowTitle("Host Settings")
        self.exePath = exePath
        self.setFixedSize(400, 300)  
        layout = QVBoxLayout(self)

        formLayout = QFormLayout()

        self.portInput = QLineEdit()
        self.portInput.setPlaceholderText("25200")
        formLayout.addRow("Port:", self.portInput)

        self.clientCountInput = QLineEdit()
        self.clientCountInput.setPlaceholderText("16")
        formLayout.addRow("Max Client Count:", self.clientCountInput)

        self.levelInput = QComboBox()
        self.levelInput.addItems(["GardenCenter", ])  
        formLayout.addRow("Level:", self.levelInput)

        self.submitButton = QPushButton("Start")
        self.submitButton.clicked.connect(self.launchHost)

        layout.addLayout(formLayout)
        layout.addWidget(self.submitButton)

    def launchHost(self):
        port = self.portInput.text() or "25200"
        clientCount = self.clientCountInput.text() or "16"
        level = self.levelInput.currentText()

        server_args = [
            "-RenderDevice.NullDriverEnable", "true",
            "-Core.HardwareProfile", "Hardware_Low",
            "-Core.HardwareGpuBias", "-1",
            "-DebrisSystem.Enable", "false",
            "-Client.WorldRenderEnabled", "false",
            "-Client.EmittersEnabled", "false",
            "-Client.TerrainEnabled", "false",
            "-Client.MeshMergingEnabled", "false",
            "-Client.OvergrowthEnabled", "false",
            "-Client.OccludersEnabled", "true",
            "-Decal.SystemEnable", "false",
            "-Render.DebugRendererEnable", "false",
            "-UI.HudEnable", "false",
            "-EmitterSystem.Enable", "false",
            "-Window.Fullscreen", "false",
            "-Render.NullRendererEnable", "true",
            "-disable-input", "true",
            "-scripted-input", "true",
            "-use-script-input", "true",
            "-disable-client-correction", "true",
            "-disable-client-animations", "true",
            "-Sound.Enable", "false",
            "-disable-entities", "true",
            "-disable-camera", "true",
            "-Texture.LoadingEnabled", "false",
            "-Texture.RenderTexturesEnabled", "false",
            "-Mesh.LoadingEnabled", "false",
            "-ShaderSystem.DatabaseLoadingEnable", "false",
            "-disable-audio-loading", "true",
            "-GameTime.ForceUseSleepTimer", "true",
            "-dedicated", "true",
            "-GameAnimation.ServerEnable", "true",
            "-Server.forcePlaylist", "false",
            "-Server.forceStartMapOnLoad", "false",
            "-Network.ServerPort", port,
            "-Network.MaxClientCount", clientCount,
            "-Game.Level", level
        ]

        if self.exePath:
            QProcess.startDetached(self.exePath, server_args)
            self.accept()
        else:
            QMessageBox.critical(self, "Error", "Please ensure the executable path is set.")

class JoinDialog(QDialog):
    def __init__(self, exePath):
        super().__init__()
        self.setWindowTitle("Join Settings")
        self.exePath = exePath
        self.setFixedSize(400, 300)  

        layout = QVBoxLayout(self)

        formLayout = QFormLayout()
        self.ipInput = QLineEdit()
        self.usernameInput = QLineEdit()
        self.modpackInput = QLineEdit()
        formLayout.addRow("IP:", self.ipInput)
        formLayout.addRow("Username:", self.usernameInput)
        formLayout.addRow("Modpack:", self.modpackInput)

        self.submitButton = QPushButton("Start")
        self.submitButton.clicked.connect(self.launchJoin)

        layout.addLayout(formLayout)
        layout.addWidget(self.submitButton)

    def launchJoin(self):
        ip = self.ipInput.text()
        username = self.usernameInput.text()
        modpack = self.modpackInput.text()
        if self.exePath and ip and username and modpack:
            QProcess.startDetached(self.exePath, ["--playerName", username, "--Client.ServerIp", ip, "-dataPath", modpack])
            self.accept()
        else:
            QMessageBox.critical(self, "Error", "Please enter all fields and ensure the executable path is set.")

class MainWindow(QMainWindow):
    def __init__(self):
        super().__init__()
        self.setWindowTitle("ProjectOutlawn")
        self.setFixedSize(700, 400)  

       
        base64_image = """<>"""  

       
        image_data = base64.b64decode(base64_image)
        pixmap = QPixmap()
        pixmap.loadFromData(image_data)

        background_label = QLabel(self)
        background_label.setPixmap(pixmap)
        background_label.setScaledContents(True)
        background_label.setGeometry(0, 0, self.width(), self.height())
        background_label.lower() 

      
        base64_icon = ""  
       
        icon_data = base64.b64decode(base64_icon)
        icon_pixmap = QPixmap()
        icon_pixmap.loadFromData(icon_data)
        self.setWindowIcon(QIcon(icon_pixmap))

        mainLayout = QVBoxLayout()

       
        hostButton = QPushButton("Host")
        joinButton = QPushButton("Join")
        findFolderButton = QPushButton("Find Game Folder")

        button_font_size = 22  
        button_padding =14    

        
        buttonStyle = f"""
        QPushButton {{
            background-color: rgba(76, 86, 106, 0.8);
            color: #ECEFF4;
            font-size: {button_font_size}px;
            padding: {button_padding}px;
            border-radius: 5px;
            font-family: 'Arial', sans-serif;
        }}
        QPushButton:hover {{
            background-color: rgba(94, 129, 172, 0.8);
        }}
        """
        hostButton.setStyleSheet(buttonStyle)
        joinButton.setStyleSheet(buttonStyle)
        findFolderButton.setStyleSheet(buttonStyle)

        
        hostButton.setSizePolicy(QSizePolicy.Expanding, QSizePolicy.Expanding)
        joinButton.setSizePolicy(QSizePolicy.Expanding, QSizePolicy.Expanding)
        findFolderButton.setSizePolicy(QSizePolicy.Expanding, QSizePolicy.Expanding)

       
        buttonLayout = QVBoxLayout()
        buttonLayout.setAlignment(Qt.AlignCenter) 

       
        buttonLayout.addItem(QSpacerItem(20, 40, QSizePolicy.Minimum, QSizePolicy.Expanding))
        buttonLayout.addWidget(hostButton)
        buttonLayout.addWidget(joinButton)
        buttonLayout.addWidget(findFolderButton)
        buttonLayout.addItem(QSpacerItem(20, 40, QSizePolicy.Minimum, QSizePolicy.Expanding))

        buttonContainer = QWidget()
        buttonContainer.setLayout(buttonLayout)

        
        hLayout = QHBoxLayout()
        hLayout.addStretch(1)
        hLayout.addWidget(buttonContainer)
        hLayout.addStretch(1)

        
        mainLayout.addStretch(1)
        mainLayout.addLayout(hLayout)
        mainLayout.addStretch(1)

        self.exePath = None
        self.findGameFolder(auto_search=True)

        hostButton.clicked.connect(self.openHostDialog)
        joinButton.clicked.connect(self.openJoinDialog)
        findFolderButton.clicked.connect(lambda: self.findGameFolder(auto_search=False))

        centralWidget = QWidget()
        centralWidget.setLayout(mainLayout)
        self.setCentralWidget(centralWidget)

    def openHostDialog(self):
        dialog = HostDialog(self.exePath)
        dialog.exec_()

    def openJoinDialog(self):
        dialog = JoinDialog(self.exePath)
        dialog.exec_()

    def findGameFolder(self, auto_search):
        if auto_search:
            gameRegistryItem = QSettings("HKEY_LOCAL_MACHINE\\SOFTWARE\\WOW6432Node\\PopCap\\Plants vs Zombies Garden Warfare", QSettings.NativeFormat)
            installDir = gameRegistryItem.value("Install Dir")
            if installDir:
                self.exePath = installDir + "\\PVZ.Main_Win64_Retail.exe"
                if os.path.isfile(self.exePath):
                    QMessageBox.information(self, "Success", "The installation directory for the game was found.")
                else:
                    self.exePath = None
                    QMessageBox.critical(self, "Error", "The installation directory for the game was found, but the executable was not found.")
            else:
                QMessageBox.critical(self, "Error", "The installation directory for the game was not found in the registry.")
        else:
            folder = QFileDialog.getExistingDirectory(self, "Find Game Folder")
            if folder:
                self.exePath = folder + "PVZ.Main_Win64_Retail.exe"
                if os.path.isfile(self.exePath):
                    QMessageBox.information(self, "Success", "The installation directory for the game was set successfully.")
                else:
                    self.exePath = None
                    QMessageBox.critical(self, "Error", "The selected directory does not contain the game executable.")
            else:
                QMessageBox.critical(self, "Error", "No directory was selected.")

if __name__ == "__main__":
    app = QApplication(sys.argv)
    translator = QTranslator()
    uiLanguages = QLocale.system().uiLanguages()
    for locale in uiLanguages:
        baseName = "GWLauncher_" + QLocale(locale).name()
        if translator.load(":/i18n/" + baseName):
            app.installTranslator(translator)
            break

    window = MainWindow()
    window.show()
    sys.exit(app.exec_())
